	('9ae36b33-345a-4db8-bf33-4b64238e8af2', '2024-03-04 14:02:41.112474+00', 0, 'Dragon Flag Kipping', 'reps', 'https://www.youtube.com/watch?v=5vELTZdjzm0', '<ul class="editor-list"><li><p>Suba as pernas com elas estendidas, e faça a abertura de quadril assim que os pés chegarem em cima.</p></li><li><p>Movimento de quadril tem que ser rápido e agressivo.</p></li></ul>'),
