	('6524704c-79ae-4d95-b029-03cf89ba53de', '2024-03-04 13:59:19.013535+00', 0, 'Abertura de Quadril no Solo', 'reps', 'https://www.youtube.com/watch?v=WdquHO6bQlw', '<ul class="editor-list"><li><p>Faça o movimento de abertura de quadril rápido e agressivo.</p></li><li><p>Inicie com pernas estendidas e pode terminar com elas um pouco flexionadas.</p></li><li><p>O quadril deve subir antes de os pés tocarem no chão.</p></li></ul>'),
	('fcb4b5c2-7b5e-4dd3-914f-52081f32ae71', '2024-03-04 14:06:51.806797+00', 0, 'Abertura de quadril barra baixa', 'reps', 'https://www.youtube.com/watch?v=JFP1Prg-cUk', '<ul class="editor-list"><li><p>Coloque a barra na altura que consiga sentar no chão um poco a frente da barra. </p></li><li><p>Faça com que os pés cheguem perto da barra para depois fazer a ativação de quadril.</p></li><li><p>Quadril deve subir rápido e agressivo, ele deve subir antes de os pés tocarem no solo.</p></li><li><p>Se as pernas fizerem um leve arco, sem problemas.</p></li></ul>'),
	('1b2ad84b-de3a-4019-888d-7500fe1614ec', '2024-03-04 14:06:22.867708+00', 0, 'T2B barra baixa', 'reps', 'https://www.youtube.com/watch?v=jYU--Vy0w8s', '<ul class="editor-list"><li><p>Coloque a barra em uma altura que consiga sentar no chão a frente da linha da barra.</p></li><li><p>Contraia seu abdômen levando os pés até a barra.</p></li></ul>'),
	('8022764b-aca7-443a-9744-a161ca828571', '2024-03-04 14:05:04.150553+00', 0, 'C2B Kippping', 'reps', 'https://www.youtube.com/watch?v=HOxG5Ih5W3o', '<ul class="editor-list"><li><p>Comece de baixo da barra para iniciar o balanço.</p></li><li><p>Objetivo é fazer o kipping e tocar o peito na barra.</p></li><li><p>Se for preciso utilize um elástico.</p></li></ul>'),
	('275951e6-4855-49b0-9bb0-0ef731276658', '2024-03-04 13:59:56.827004+00', 0, 'V-up', 'reps', 'https://www.youtube.com/watch?v=i05XEXPmq60', '<ul class="editor-list"><li><p>Comece com braços e pernas estendidas no chão,</p></li><li><p>objetivo é chegar com as mãos o mais perto dos pés, fazendo a contração do abdômen.</p></li></ul>'),
	('57a4b41e-8e6e-4300-8da7-df0921f1ea9d', '2024-03-04 14:08:40.964729+00', 0, 'BMU barra baixa com caixa tirando os pés', 'reps', 'https://www.youtube.com/watch?v=0ldguNwfZWc', '<ul class="editor-list"><li><p>Inicie com os pés na caixa, e braços estendidos.</p></li><li><p>Faça o movimento de empurrar a barra pra baixo, ao mesmo tempo que ajuda com as pernas.</p></li><li><p>Impulsione com as pernas e faça a entrada para cima da barra tirando os pés da caixa.</p></li></ul>'),
	('19c7ee92-69ba-4fc6-bcb8-9b96bd81a3ef', '2024-03-04 14:20:20.6094+00', 0, 'C2B strict', 'reps', 'https://www.youtube.com/watch?v=Zki3YrdHPGU', '<ul class="editor-list"><li><p>Execute uma puxada até tocar o peito na barra.</p></li><li><p>Se precisar use elástico.</p></li></ul>'),
	('9d1715cf-9cfc-4728-8fff-091ae0553ce3', '2024-03-04 14:12:42.831635+00', 0, 'Cuff Rotation', 'reps', 'https://www.youtube.com/watch?v=toofnQa3vDU', '<ul class="editor-list"><li><p>com uma band faça uma rotação externa.</p></li><li><p>Mantenha os cotovelos próximo do corpo.</p></li></ul>'),
	('10669909-7513-43be-bd52-25bc0e4de48a', '2024-03-04 14:14:33.116122+00', 0, 'Entrada barra alta com caixa', 'reps', 'https://www.youtube.com/watch?v=ysFWyHmLWGo', '<ul class="editor-list"><li><p>Com a barra na altura do queixo, salte para cima da barra, ataque com o tronco pra frente com velocidade.</p></li></ul>'),
	('e97c47df-1a7b-4c1e-a4f2-ab04802cb937', '2024-03-04 14:10:40.206213+00', 0, 'Farm Walk', 'reps', 'https://www.youtube.com/watch?v=e2cnjP6qSn8', '<ul class="editor-list"><li><p>mantenha abdômen contraído e escapulas encaixadas.</p></li></ul>'),
	('98c59328-e05d-4921-9fa5-44cd2c4a1426', '2024-03-04 14:19:52.119143+00', 0, 'Parallete Support', 'reps', 'https://www.youtube.com/watch?v=FV_GdpDPJxo', '<ul class="editor-list"><li><p>Em uma paralela ou na caixa, fique com cotovelos estendidos e abdômen contraído.</p></li><li><p>Os pés devem ficar levemente a frente, e seu corpo em posição de Hollow.</p></li></ul>'),
	('f6df38d3-a9dd-48d9-bacf-1cc960b92bc4', '2024-03-04 14:11:49.55628+00', 0, 'Ring Row', 'reps', 'https://www.youtube.com/watch?v=i7k8kTX82Xc', '<ul class="editor-list"><li><p>Puxe os cotovelos para trás próximo do corpo, mantendo seu corpo conectado.</p></li><li><p>Coloque os pés o mais pra frente que conseguir e pernas estendidas.</p></li></ul>'),
	('4d9b2e98-58a3-4a13-a14d-a56304a9d0af', '2024-03-04 14:16:54.549959+00', 0, 'Ring Row support', 'reps', 'https://www.youtube.com/watch?v=mfO8IEH9cA4', '<ul class="editor-list"><li><p>Faça uma remada com as mãos em pegada falsa, e segure a argola o mais próximo do peitoral.</p></li></ul>'),
	('21de1fbd-b40c-4ae6-b8c4-c446e6840cdd', '2024-03-04 13:57:10.89007+00', 0, 'Hollow Rock', 'reps', 'https://www.youtube.com/watch?v=_9p4lLVpZII', '<ul class="editor-list"><li><p>Comece tirando a cabeça e as escapulas do chão, em seguida as pernas.</p></li><li><p>Costas bem arredondadas e abdômen bem contraído</p></li><li><p>Faça o Balanço bem curto.</p></li><li><p>Se ficar difícil de fazer com braços estendidos, flexione os joelhos e coloque as mãos na linha do quadril.</p></li></ul>'),
	('67df94d8-5683-4447-bf2e-084dd5fb34a8', '2024-03-04 14:00:27.623751+00', 0, 'Strict Pull Up', 'reps', 'https://www.youtube.com/watch?v=Qw1qnWoko7U', '<ul class="editor-list"><li><p>Inicie o movimento com Braços estendidos e faça uma puxada até o queixo passar da altura da barra.</p></li><li><p>Se tiver dificuldade de fazer esse movimento use elástico, um elástico que deixe o movimento bem completo porem não fique muito fácil..</p></li></ul>'),
	('77c27b4f-2e90-4792-b94f-27247e4e2b87', '2024-03-04 14:01:44.289949+00', 0, 'Banded Full Apart', 'reps', 'https://www.youtube.com/watch?v=UbzfI-4Mrmo', '<ul class="editor-list"><li><p>Ajoelho no chão faça uma puxada com elástico.</p></li><li><p>Use um elástico forte.</p></li></ul>'),
	('ae2d5d2b-26c6-40a8-a455-0245fec9510c', '2024-03-04 13:58:07.059382+00', 0, 'Pull Down', 'reps', 'https://www.youtube.com/watch?v=_kDYq9IVHqA', '<ul class="editor-list"><li><p>Realize o movimento de puxada do bastão até o quadril.</p></li><li><p>Lembre você deve puxar e não empurrar.</p></li><li><p>Foque em encaixar as escapulas.</p></li></ul>'),
	('5c3094cd-02fb-46ad-8bc2-98dace3d4c59', '2024-03-04 14:03:27.624862+00', 0, 'Kipping Swing', 'reps', 'https://www.youtube.com/watch?v=QuOYgyaeFc4', '<ul class="editor-list"><li><p>Inicie bem de baixo da barra.</p></li><li><p>Com braços estendidos e relaxados, faça o movimento de levar a barra pra frente e pra trás.</p></li><li><p>Lembre o movimento é feito com os ombros e a perna acompanha e não o contrario.</p></li></ul>'),
	('b05c3342-20e0-4367-8db2-845e3f88f2a9', '2024-03-04 14:03:53.439274+00', 0, 'Push Up', 'reps', 'https://www.youtube.com/watch?v=9tPVB-fkANQ', '<ul class="editor-list"><li><p>Inicie o movimento com braços estendidos.</p></li><li><p>Flexione os cotovelos próximo do corpo até tocar o peito no chão.</p></li><li><p>Empurre com velocidade.</p></li></ul>'),
	('b0c565b2-26da-42bb-9111-e3aa1da7d08e', '2024-03-04 13:56:18.485808+00', 0, 'Scapula Pull', 'reps', 'https://www.youtube.com/watch?v=tNlbnGGtdao', '<ul class="editor-list"><li><p>Inicie com os braços estendidos e faça apenas o encaixe e desencaixe das escapulas.</p></li><li><p>Não flexione os cotovelos.</p></li></ul>'),
	('a0661bee-0ac5-44b5-9f3c-0982d3cba0b6', '2024-03-04 14:17:32.239579+00', 0, 'Abdominal Roll Bar', 'reps', 'https://www.youtube.com/watch?v=HDLUdH9sJr0', '<ul class="editor-list"><li><p>Faça o movimento de extensão de quadril e braços.</p></li><li><p>Quanto mais vc conseguir descer melhor.</p></li><li><p>Mantenha as costas levemente arredondadas para manter o abdômen contraído.</p></li><li><p>Não volte as pernas para depois os braços, tente fazer o movimento todo junto.</p></li></ul>'),
	('ed5d066c-53df-4b57-8583-ab16ff5ed458', '2024-03-04 14:21:34.316755+00', 0, 'Arch', 'reps', 'https://www.youtube.com/watch?v=TcuZ38COEnY', '<ul class="editor-list"><li><p>Faça o movimento de subir as pernas e braços ao mesmo tempo.</p></li><li><p>Contraia o Glúteo e lombar.</p></li></ul>'),
	('a43d8c06-3d96-4eb2-99cb-8d64f1a9007b', '2024-03-04 14:09:22.245151+00', 0, 'BMU barra baixa com caixa', 'reps', 'https://www.youtube.com/watch?v=0pNPiINduDE', '<ul class="editor-list"><li><p>Coloque a barra na altura do Umbigo</p></li><li><p>Inicie o movimento com joelho flexionados.</p></li><li><p>Faça a entrada do BMU, sem estender os cotovelos em cima.</p></li><li><p>Comece fazendo o movimento sem tirar os pés da caixa.</p></li><li><p>Conforme se sentir confiante faça tirando os pés.</p></li></ul>'),
	('947a7a80-ab6c-4450-9931-ed8fa1805c31', '2024-03-05 13:25:00.803546+00', 0, 'Abertura de Quadril com entrada na barra baixa', 'reps', 'https://www.youtube.com/watch?v=Jr1xVVceRj0', '<ul class="editor-list"><li><p>Faça força com os braços para se embalar para trás ao mesmo tempo que faz a abertura de quadril.</p></li><li><p>Não esqueça de fazer o quadril sair do chão antes de os pés tocarem no chão.</p></li><li><p>Faça a entrada pra cima da barra o mais rápido possível depois de os pés tocarem no chão.</p></li></ul>'),
	('c215dc8e-622d-4ab5-ac0e-4cefa533dbf2', '2024-03-05 13:29:59.499671+00', 0, 'Russian Push Up', 'reps', 'https://www.youtube.com/watch?v=mn7i3WjgDEk', '<ul class="editor-list"><li><p>Faça a a flexão de cotovelos até o peito chegar bem próximo do chão.</p></li><li><p>Empurre o corpo para trás, fazendo seu cotovelo chegar próximo do chão.</p></li><li><p>Os pés devem arrastar no chão.</p></li><li><p>Faça forca para voltar a posição inicial o mais rápido possível.</p></li></ul>'),
	('d87f85fc-bba2-4a00-b6b6-950095ed2262', '2024-03-04 14:01:01.113053+00', 0, 'Banded Deadbug', 'reps', 'https://www.youtube.com/watch?v=vKvS40dfTmc', '<ul class="editor-list"><li><p>Fique em posição de prancha com os braços estendidos fazendo força para fechar o abdômen.</p></li><li><p>você deve fazer força para empurras o elástico para frente o tempo todo.</p></li><li><p>comece com as pernas estendidas e flexione uma cada cada vez alternando, bem lentamente.</p></li></ul>'),
	('5e79e8a1-cc51-4b11-a8a2-4447481acdb7', '2024-03-04 14:09:50.197917+00', 0, 'Entrada Barra baixa', 'reps', 'https://www.youtube.com/watch?v=tcZllM84pP4', '<ul class="editor-list"><li><p>Coloque a barra um pouco acima da altura do umbigo.</p></li><li><p>Flexione os joelho com as braços estendidos.</p></li><li><p>Salte para cima e se puxe rapidamente para cima da barra.</p></li><li><p>Termine o movimento com os cotovelos para trás da linha do ombro.</p></li></ul>'),
	('70056070-0716-4cf2-a243-7f6266689f92', '2024-03-04 14:04:31.838469+00', 0, 'Dip Barra Baixa', 'reps', 'https://www.youtube.com/watch?v=vh2nkUVh9mE', '<ul class="editor-list"><li><p>Coloque uma barra na altura que nao toque os pés no chão.</p></li><li><p>Corpo sempre um pouco a frente da linha da barra.</p></li><li><p>Toque um pouco abaixo do peito na barra quando flexionar os cotovelos.</p></li></ul>'),
	('29e06af5-d6af-4967-a9cb-aefd8ed31561', '2024-03-05 16:14:03.570572+00', 0, 'BMU', 'reps', 'https://www.youtube.com/watch?v=BOvhWDKqTbg', '<ul class="editor-list"><li><p>Comece da maneira que você se sentir mais confortável, de cima da anilha, com caixa ou as travas do rack.</p></li></ul>'),
	('deaaadbc-03ef-4e30-8759-4bc24e630ed5', '2024-03-05 16:15:28.103303+00', 0, 'BMU com ajuda de um colega', 'reps', 'https://www.youtube.com/watch?v=BKl50iiMhRo', '<ul class="editor-list"><li><p>Comece da maneira que você se sentir mais confortável, de cima da anilha, com caixa ou as travas do rack.</p></li><li><p>Peça pra um colega te ajudar com uma leve empurrada nas costas.</p></li></ul>'),
	('42ada228-0c20-4b07-8dae-27bd4c7596c1', '2024-03-05 16:19:58.56576+00', 0, 'BMU banded', 'reps', 'https://www.youtube.com/watch?v=mMpKfvk3iIQ', '<ul class="editor-list"><li><p>Com dois elásticos cruzando um cada pé.</p></li><li><p>Comece da maneira que você se sentir mais confortável, de cima da anilha, com caixa ou as travas do rack.</p></li><li><p>Lembre de chutar com os pés e fazer abertura de quadril ao mesmo tempo q se puxa para cima da barra.</p></li><li><p>Tente descer se afastando um pouco para trás da barra, mas não exagere, e tente emendar os movimentos.</p></li><li><p>Se for preciso inicie o movimento no terceiro kipping.</p></li></ul>'),
	('c65bde8d-7817-4a84-91a7-647967959b0c', '2024-03-05 16:22:26.7992+00', 0, 'Ring Row Unilateral', 'reps', 'https://www.youtube.com/watch?v=xL0PMkQWvT4', '<ul class="editor-list"><li><p>Faça a remada com uma mão sem deixar o corpo fazer rotação.</p></li><li><p>Mantenha corpo todo contraído.</p></li><li><p>Quanto mais o pé estiver para frente mais pesado ficara.</p></li></ul>'),
	('2b490130-5480-4bf5-b672-1d25345f3245', '2024-03-05 16:26:48.62051+00', 0, 'Negative Pull Up', 'reps', 'https://www.youtube.com/watch?v=dSZCEpJaSjI', '<ul class="editor-list"><li><p>Encontre uma barra onde encoste os pés no chão.</p></li><li><p>Impulsione o mínimo com os pés, e puxe rápido.</p></li><li><p>Faça a descida lentamente.</p></li></ul>'),
	('61f09459-ef85-4132-b097-df93d3b548e4', '2024-03-05 16:33:19.381092+00', 0, 'Ice Cream Maker', 'reps', 'https://www.youtube.com/watch?v=WfzZrza3N9k', '<ul class="editor-list"><li><p>Se puxe até passar o queixo da barra para iniciar o movimento.</p></li><li><p>Suba os pés ao mesmo tempo que desce o tronco para trás, sem estender completamente os braços.</p></li><li><p>Mantenha o Abdômen bastante contraído.</p></li></ul>'),
	('ee8b28b9-2a8b-425b-b39c-967c8af67ef7', '2024-03-05 16:38:03.612834+00', 0, 'Dip Bar', 'reps', 'https://www.youtube.com/watch?v=Ueqf7aNeV2k', '<ul class="editor-list"><li><p>Extensão do cotovelo em cima da barra.</p></li><li><p>Pode usar impulso das pernas.</p></li></ul>'),
	('dd8acac8-6e8b-454f-92fd-6938a920eb31', '2024-03-05 16:42:51.442823+00', 0, 'BMU com caixa', 'reps', 'https://www.youtube.com/watch?v=WuYQxHA4_nY', '<ul class="editor-list"><li><p>inicie com os pés em cima da caixa.</p></li><li><p>Faça o kipping e em seguida salte com as pernas ao mesmo tempo que se puxa pra cima da barra.</p></li><li><p>Tente emendar os movimentos, descendo com o corpo um pouco pra trás.</p></li></ul>'),
	('65d4a7ad-6da8-4601-bb9d-822eb629c666', '2024-03-05 16:46:12.766798+00', 0, 'Triceps Banco', 'reps', 'https://www.youtube.com/watch?v=wF_2lc9EB6w', '<ul class="editor-list"><li><p>Em uma caixa ou banco, faça a flexão e extensão de cotovelos.</p></li><li><p>Mantenha as pernas estendidas, se possível coloque os pés em cima de outra caixa ou banco.</p></li></ul>'),
	('d7e57ac0-c77a-43b4-9612-43970f4c951f', '2024-03-06 16:17:54.040405+00', 0, 'Simulate BMU PVC', 'reps', 'https://www.youtube.com/watch?v=XwjWXS3tgls', '<ul class="editor-list"><li><p>Com o corpo estendido no chão e bastão acima da cabeça.</p></li><li><p>Faça a elevação de pernas e em seguida abertura de quadril ao mesmo tempo que leva o bastão no quadril.</p></li></ul>'),
	('0f16250a-2533-4dcd-831a-84a5dfcea3af', '2024-03-06 16:19:05.519573+00', 0, 'Shoulder Taps', 'reps', 'https://www.youtube.com/watch?v=a30pnoYiWx8', '<ul class="editor-list"><li><p>Em prancha alta, alterne suas mão tocando no ombro.</p></li><li><p>Tente não rotacionar muito seu corpo.</p></li></ul>'),
	('852385a8-c2aa-4299-b712-1d036e91270a', '2024-03-06 16:21:11.959636+00', 0, 'Push Up Déficit ', 'reps', 'https://www.youtube.com/watch?v=i9ZXPuUDRrQ', '<ul class="editor-list"><li><p>Faça a flexão de braço com as mãos em cima de uma anilha ou qualquer instrumento que consiga usar para aumentar a amplitude de movimento.</p></li><li><p>Toque o peito no chão ou próximo dele.</p></li></ul>'),
	('4cb5d27f-a887-4413-a4e3-0a0b845b149a', '2024-03-06 16:23:34.536044+00', 0, 'Hollow Rock Banded', 'reps', 'https://www.youtube.com/watch?v=RocCpPkMwwQ', '<ul class="editor-list"><li><p>Com braços e pernas estendidas, contraia bem seu abdômen e tira os pés e as escapulas do chão arredondando suas costas.</p></li><li><p>Segure o elástico um pouco acima da cabeça, para que você tenha que fazer mais força para realizar o hollow rock.</p></li></ul>'),
	('00813625-20aa-4154-b553-6330bbb8d083', '2024-03-04 14:19:11.542861+00', 0, 'First Kipping Hollow', 'reps', 'https://www.youtube.com/watch?v=FAjcSdjGdAM', '<ul class="editor-list"><li><p>Inicie de cima de uma anilha, para facilitar seu balanço.</p></li><li><p>Salte com os pés pra frente e corpo em posição de hollow e mantenha até voltar para trás.</p></li></ul>'),
	('63b4dec1-1531-456b-8335-37aa9cfcc072', '2024-03-04 14:18:33.566791+00', 0, 'First Kipping Swing High', 'reps', 'https://www.youtube.com/watch?v=gIcZEafpfLc', '<ul class="editor-list"><li><p>Inicie de cima de uma anilha para facilitar o balanço.</p></li><li><p>Salte com os pés pra frente. em posição de hollow.</p></li><li><p>Quando seu corpo passar pra frente da linha da barra você ira realizar o movimento de Arch, levando seu peitoral e quadril para frente e pés para trás.</p></li><li><p>Quando voltar para trás da linha da barra faça novamente o hollow fazendo bastante força de braços para empurrar a barra para baixo, e ative bem seu quadril e glúteo.</p></li><li><p>Tente chegar o mais alto possível em seu balanço.</p></li></ul>'),
	('35efd493-225d-4afc-9e3f-7ce439ff7f2c', '2024-03-06 16:27:12.126665+00', 0, 'First Kipping swing (Hollow e Arch)', 'reps', 'https://www.youtube.com/watch?v=yEYb_kLTuwA', '<ul class="editor-list"><li><p>Inicie de cima de uma anilha para facilitar seu balanço.</p></li><li><p>Salte com os pés pra frente. em posição de hollow.</p></li><li><p>Quando seu corpo passar pra frente da linha da barra você ira realizar o movimento de Arch, levando seu peitoral e quadril para frente e pés para trás.</p></li><li><p>Quando voltar para trás da linha da barra faça novamente o hollow.</p></li></ul>'),
	('122efb38-de42-4f87-b67c-d48c5d846352', '2024-03-06 16:34:37.987535+00', 0, 'GHD Sit Up', 'reps', 'https://www.youtube.com/watch?v=Kmc4KgI9MBg', '<ul class="editor-list"><li><p>Movimento de flexão de tronco.</p></li><li><p>Arredonde bem as costas para fazer a força no abdômen</p></li><li><p>Em ultimo caso faça no Ab Mat.</p></li></ul>'),
	('446b2ba9-f7e0-4871-a1f0-0d83d3f59387', '2024-03-06 17:12:17.968413+00', 0, 'Dip Bar Hold', 'reps', 'https://www.youtube.com/watch?v=Kmc4KgI9MBg', '<ul class="editor-list"><li><p>Suba na barra alta, e fique na posição de entrada do BMU.</p></li><li><p>Lembre de se apoiar em cima da barra, sem deixar de fazer força com os braços.</p></li><li><p>cotovelos para trás, para seu tronco ir para frente.</p></li></ul>'),
	('fb462ec3-0388-4e08-bd54-de8daeb61df4', '2024-03-06 17:43:01.861081+00', 0, 'BMU com um pé na caixa', 'reps', 'https://www.youtube.com/watch?v=FDEoCHa9_g4', '<ul class="editor-list"><li><p>Com apenas um dos pés na caixa, você ira realizar o BMU.</p></li><li><p>Inicie o movimento de Kipping swing, e Chute alto com a perna que esta livre para conseguir entrar.</p></li></ul>'),
	('30d12f52-cad2-453f-8c50-128834291457', '2024-03-06 17:44:10.903202+00', 0, 'T2B', 'reps', 'https://www.youtube.com/watch?v=U7pPl3rbgVI', '<ul class="editor-list"><li><p>Inicie de baixo da barra.</p></li><li><p>Faça o kipping swing, e leve seus pés na barra.</p></li></ul>'),
	('ec36fe22-2eba-474a-a018-08c99ab086ce', '2024-03-08 13:00:02.694935+00', 0, 'Pull Up Hold', 'reps', 'https://www.youtube.com/watch?v=-SVXYYvFU0w', '<ul class="editor-list"><li><p>Se pendure na barra e se puxe, mesmo que seja com kipping.</p></li><li><p>Segure na posição com os braços flexionados sem tocar os pés no chão.</p></li></ul>'),
	('24cbe159-6077-438b-bda6-3842db15641a', '2024-03-08 13:12:41.686532+00', 0, 'Leg Pike', 'reps', 'https://www.youtube.com/watch?v=cU2-IUyWkaI', '<ul class="editor-list"><li><p>Sentado no chão com pernas estendidas.</p></li><li><p>Levante as duas pernas usando a força do abdômen.</p></li></ul>'),
	('c8c7bd76-aa8f-479c-aa90-dc642db59680', '2024-03-08 13:23:28.443714+00', 0, 'Hollow into plate', 'reps', 'https://www.youtube.com/watch?v=xnZ-jTPmJVQ', '<ul class="editor-list"><li><p>Com anilhas ao seu lado, faça um movimento de Hollow e em seguida se jogue pra frente com as mãos nas anilhas.</p></li><li><p>Faça um movimento de entrada rápido e agressivo.</p></li></ul>'),
	('fb6469c5-1d5d-49f3-a75a-789952103665', '2024-03-08 13:25:21.067917+00', 0, 'Parallete Dip', 'reps', 'https://www.youtube.com/watch?v=cyoSYWQnC-k', '<ul class="editor-list"><li><p>Executar o movimento de Dip em uma paralela ou em caixas.</p></li><li><p>Certifique de não tocar os pés no chão.</p></li><li><p>Desça até o ombro passar levemente a linha do cotovelo.</p></li><li><p>Não desça demais para não se machucar.</p></li></ul>'),
	('916071be-beb5-4f24-b358-347aea7287e6', '2024-03-08 13:27:10.378094+00', 0, 'Bar Dip Kipping', 'reps', 'https://www.youtube.com/watch?v=E3KMqlrv8ts', '<ul class="editor-list"><li><p>Execute esse movimento na barra alta ou barra baixa.</p></li><li><p>Faça uma puxada das pernas para trás, e rapidamente estenda o cotovelo.</p></li><li><p>Aproveite a impulsão da perna para se empurrar.</p></li></ul>'),
	('3ac0a121-02ea-465e-b4b7-8593bea17c3b', '2024-03-04 14:07:24.736873+00', 0, 'Bar Hold', 'reps', 'https://www.youtube.com/watch?v=2GpFuzl58Uk', '<ul class="editor-list"><li><p>Se pendure na barra com braços estendidos.</p></li><li><p>Apenas se segure na barra.</p></li></ul>'),
	('4e79d475-1989-443d-90fe-6b95dd2fd43f', '2024-03-04 14:13:43.924121+00', 0, 'Crucifixo invertido com DB', 'reps', 'https://www.youtube.com/watch?v=YhAtLl4RySs', '<ul class="editor-list"><li><p>Com o corpo inclinado pra frente faça o movimento de Abdução dos ombros.</p></li><li><p>Leve seu cotovelo apontando para o teto.</p></li><li><p>Cotovelos levemente flexionados.</p></li></ul>'),
	('b01b7499-cf2d-4b52-b595-439a5ef70d42', '2024-03-04 14:10:16.983655+00', 0, 'Entrada Barra baixa com Dip', 'reps', 'https://www.youtube.com/watch?v=sMxvtxFSgBA', '<ul class="editor-list"><li><p>Use os pés para ajudar a fazer a entrada.</p></li><li><p>Comece com braços estendidos.</p></li><li><p>Entre com velocidade pra cima da barra.</p></li><li><p>Faça o movimento de extensão de cotovelos, pode até usar kipping das pernas.</p></li></ul>'),
	('23d5da3c-46a3-4b89-8447-a19c82108b3a', '2024-03-04 14:16:22.977667+00', 0, 'Kipping Swing Knee Raises', 'reps', 'https://www.youtube.com/watch?v=ES46cWRqEHw', '<ul class="editor-list"><li><p>Execute o balanço na barra com braços estendidos e ombros relaxados.</p></li><li><p>Puxe o joelho pra cima enquanto empurra a barra pra baixo.</p></li></ul>'),
	('92a61a5d-a472-496b-bc1c-e7fa3688cc54', '2024-03-04 14:05:35.042736+00', 0, 'Plank', 'reps', 'https://www.youtube.com/watch?v=pDloujs6-Qg', '<ul class="editor-list"><li><p>Mantenha seu abdômen contraído o tempo todo.</p></li></ul>'),
	('06ac7969-f6b0-497b-8ff0-7fc9f722a6ce', '2024-03-04 14:11:16.278139+00', 0, 'Pull Up Kipping', 'reps', 'https://www.youtube.com/watch?v=-H1FYd65WoE', '<ul class="editor-list"><li><p>Comece de baixo da barra.</p></li><li><p>Use o balanço e abertura de quadril para facilitar sua puxada.</p></li></ul>'),
	('d0a019db-45db-4a51-8766-18a022b65c55', '2024-03-04 14:22:21.951575+00', 0, 'Pull down bar', 'reps', 'https://www.youtube.com/watch?v=qVc3c1LOPwI', '<ul class="editor-list"><li><p>Com braços estendidos e ombros relaxados, faça um kipping swing forte e empurre o máximo que conseguir a barra para baixo.</p></li><li><p>Fique sempre com corpo conectado, e ative o quadril no momento de empurrar a barra pra baixo.</p></li></ul>'),
	('15b2d4ed-5c77-4185-a1c6-d337458de8d2', '2024-03-04 14:21:01.552824+00', 0, 'Touch Bar', 'reps', 'https://www.youtube.com/watch?v=M-ftnP9nVV8', '<ul class="editor-list"><li><p>De cima da anilha, pule de trás da barra e apenas toque na barra com as duas mãos, ao mesmo tempo que leva os pés levemente para frente.</p></li></ul>'),
	('15bca3ae-b3e0-4f35-8bf6-3dfe38f9ff9a', '2024-03-04 14:13:17.866285+00', 0, 'Sit Up Abmat', 'reps', 'https://www.youtube.com/watch?v=u1LmlV0Gqzc', '<ul class="editor-list"><li><p>Com a lombar apoiada no ab mat, toque as mãos acima da cabeça e faça a flexão de tronco para tocar as mãos a frente dos pés.</p></li></ul>'),
	('5e2ae575-72d7-444a-92c5-ce1a566b73b5', '2024-03-08 13:19:42.770895+00', 0, 'KippingSwing com quadril alto', 'reps', 'https://www.youtube.com/watch?v=OQHMVUumIQY', '<ul class="editor-list"><li><p>Se pendure de baixo da barra e comece o balanço pelo ombro.</p></li><li><p>Faça o Kipping swing e no próximo movimento balance mais forte e execute a abertura de quadril para aproximar o quadril da barra.</p></li><li><p>Volte para o movimento de kipping swing mais curto, e execute novamente o quadril alto, e vá alternando.</p></li></ul>'),
	('4bbc4296-2fe2-4090-a08f-cb74e349deed', '2024-03-04 14:15:31.05193+00', 0, 'Entrada com Kipping barra alta com caixa', 'reps', 'https://www.youtube.com/watch?v=viygSxCS5mM', '<ul class="editor-list"><li><p>Faça o Kpping swing com os pés na caixa.</p></li><li><p>Braços estendidos para fazer o balanço, </p></li><li><p>Com ajuda das pernas faça a entrada pra cima da barra sem precisar estender os cotovelos em cima.</p></li></ul>'),
	('64cb0a61-b393-4883-a863-c51dc12b3e20', '2024-03-08 14:51:29.415079+00', 0, 'Pull Over', 'reps', 'https://www.youtube.com/watch?v=0FPsaN9qyhI', '<ul class="editor-list"><li><p>Com as costas apoiadas no banco ou em uma bola.</p></li><li><p>Cotovelo levemente flexionados.</p></li><li><p>Leve o DB o máximo que conseguir para cima da cabeça sem sentir dor.</p></li></ul>');
