xt","text":"seu corpo, "},{"type":"text","marks":[{"type":"bold"}],"text":"aprimorar "},{"type":"text","text":"sua "},{"type":"text","marks":[{"type":"bold"}],"text":"técnica "},{"type":"text","text":"e "},{"type":"text","marks":[{"type":"bold"}],"text":"aumentar "},{"type":"text","text":"sua "},{"type":"text","marks":[{"type":"bold"}],"text":"confiança"},{"type":"text","text":". Tenho certeza de que, com "},{"type":"text","marks":[{"type":"bold"}],"text":"dedicação "},{"type":"text","text":"e "},{"type":"text","marks":[{"type":"bold"}],"text":"comprometimento"},{"type":"text","text":", você alcançará os resultados esperados."}]},{"type":"paragraph","attrs":{"textAlign":"left"}},{"type":"paragraph","attrs":{"textAlign":"left"},"content":[{"type":"text","text":"Vamos começar esta jornada rumo ao "},{"type":"text","marks":[{"type":"bold"}],"text":"Bar Muscle Up"},{"type":"text","text":" juntos. Parabéns mais uma vez e vamos trabalhar duro para alcançar seus objetivos!"}]}]}'),
